import React from "react";
import "../css/AboutPage.css"; // Import the CSS for styling

function AboutPage() {
    return (
        <div className="about-page">
            <h1>About Us</h1>
            <p>
                Welcome to our Chatbot application! Our goal is to create an intuitive and interactive
                AI-powered experience to assist users with their queries and tasks.
            </p>
            <p>
                This project is built using modern web technologies such as React, React Router, and
                customizable components. We strive to make the chatbot accessible, efficient, and user-friendly.
            </p>
            <p>
                If you'd like to learn more about our project or team, feel free to explore or reach out via the
                Contact page.
            </p>
        </div>
    );
}

export default AboutPage;
